# Models for multivariate count data

### If we were in a Gaussian world...

The .important[general linear model] [MKB79] would be appropriate! For each sample `\(i = 1,\dots,n\)`, 

`$$\underbrace{\mathbf{Y}_i}_{\text{abundances}} =  \underbrace{\mathbf{x}_i^\top \mathbf{B}}_{\text{covariates}} + \underbrace{\mathbf{o}_i}_{\text{sampling effort}} + \boldsymbol\varepsilon_i, \quad \boldsymbol\varepsilon_i \sim \mathcal{N}(\mathbf{0}_p, \underbrace{\boldsymbol\Sigma}_{\text{between-species dependencies}})$$`

null covariance `\(\Leftrightarrow\)` independence `\(\rightsquigarrow\)` uncorrelated species/transcripts do not interact

.content-box-red[This model gives birth to Principal Component Analysis,
 Discriminant Analysis, Gaussian Graphical Models, Gaussian Mixture models and many others `\(\dots\)`]

### With count data...

There is no generic model for multivariate counts
  - Data transformation (log, `\(\sqrt{}\)`) : quick and dirty
  - Non-Gaussian multivariate distributions [Ino+17]: do not scale to data dimension yet
  - .important[Latent variable models]: interaction occur in a latent (unobserved) layer

---

# The Poisson Lognormal model (PLN)

The PLN model [AH89] is a .important[multivariate generalized linear model], where 

- the counts `\(\mathbf{Y}_i\)` are the response variables
- the main effect is due to a linear combination of the covariates `\(\mathbf{x}_i\)`
- a vector of offsets `\(\mathbf{o}_i\)` can be specified for each sample.

.content-box-red[
$$
\mathbf{Y}_i | \mathbf{Z}_i \sim \mathcal{P}\left(\exp\{\mathbf{Z}_i\}\right), \qquad \mathbf{Z}_i \sim \mathcal{N}({\mathbf{o}_i + \mathbf{x}_i^\top\mathbf{B}},\boldsymbol\Sigma), \\
$$
]
.pull-left[The unkwown parameters are 
- `\(\mathbf{B}\)`, the regression parameters
- `\(\boldsymbol\Sigma\)`, the variance-covariance matrix
]

.pull-right[
Stacking all individuals together, 
  - `\(\mathbf{Y}\)` is the `\(n\times p\)` matrix of counts  
  - `\(\mathbf{X}\)` is the `\(n\times d\)` matrix of design
  - `\(\mathbf{O}\)` is the `\(n\times p\)` matrix of offsets
]

### Properties: .small[.important[over-dispersion, arbitrary-signed covariances]]

- mean: `\(\mathbb{E}(Y_{ij}) =  \exp \left( o_{ij} + \mathbf{x}_i^\top {\mathbf{B}}_{\cdot j} + \sigma_{jj}/2\right) &gt;  0\)`
- variance: `\(\mathbb{V}(Y_{ij}) = \mathbb{E}(Y_{ij}) + \mathbb{E}(Y_{ij})^2 \left( e^{\sigma_{jj}} - 1 \right) &gt; \mathbb{E}(Y_{ij})\)`
- covariance: `\(\mathrm{Cov}(Y_{ij}, Y_{ik}) = \mathbb{E}(Y_{ij}) \mathbb{E}(Y_{ik}) \left( e^{\sigma_{jk}} - 1 \right).\)`


---

# Natural extensions

### Various tasks of multivariate analysis

  - .important[Dimension Reduction]: rank constraint matrix `\(\boldsymbol\Sigma\)`.
    
    `$$\mathbf{Z}_i \sim \mathcal{N}(\boldsymbol\mu, \boldsymbol\Sigma = \mathbf{C}\mathbf{C}^\top), \quad \mathbf{C} \in \mathcal{M}_{pk} \text{ with orthogonal columns}.$$`

  - .important[Classification]: maximize separation between groups with means 

  `$$\mathbf{Z}_i \sim \mathcal{N}({\boldsymbol\mu}_k \mathbf{1}_{\{i\in k\}}, \boldsymbol\Sigma), \quad \text{for known memberships}.$$`

  - .important[Clustering]: mixture model in the latent space 

  `$$\mathbf{Z}_i \mid i \in k  \sim \mathcal{N}(\boldsymbol\mu_k, \boldsymbol\Sigma_k), \quad \text{for unknown memberships}.$$`

  - .important[Network inference]: sparsity constraint on inverse covariance.
  
  `$$\mathbf{Z}_i \sim \mathcal{N}(\boldsymbol\mu, \boldsymbol\Sigma = \boldsymbol\Omega^{-1}), \quad \|\boldsymbol\Omega \|_1 &lt; c.$$`

  - .important[Variable selection]: sparsity constraint on regression coefficients
  
  `$$\mathbf{Z}_i \sim \mathcal{N}(\mathbf{x}_i^\top\mathbf{B}, \boldsymbol\Sigma), \quad \|\mathbf{B} \|_1 &lt; c.$$`

# Illustration on ecological environmental DNA 

### Oaks powdery mildew data set

Jakuschkin, Fievet, Schwaller et al. [Jak+16] Study .important[effects of the pathogen] _E.Aphiltoïdes_ (mildew) wrt bacterial and microbial communities

### Species Abundances

- .important[Microbial communities] sampled on the surface of `\(n = 116\)` oak leaves
- Communities sequenced and cleaned resulting in `\(p=114\)` OTUs (66 bacteria, 48 fungi).

### Covariates and offsets

Characterize the samples and the sampling, most important being

- `tree`: Tree status with respect to the pathogen (susceptible, intermediate or resistant)
- `distTOground`: Distance of the sampled leaf to the base of the ground
- `orientation`: Orientation of the branch (South-West SW or North-East NE)
- `readsTOTfun`: Total number of ITS1 reads for that leaf
- `readsTOTbac`: Total number of 16S reads for that leaf

#  PLN with offsets and covariates (1)

## Offset: .small[modeling sampling effort]

# Variational inference for standard PLN&lt;br/&gt; .small[Optimisation]

&lt;!-- VARIATIONAL INFERENCE --&gt;


---
# Inference: general ingredients
  
Estimate `\(\theta = (\mathbf{B}, \boldsymbol\Sigma)\)`, predict the `\(\mathbf{Z}_i\)`, while  the model marginal likelihood is

`$$p_\theta(\mathbf{Y}_i) = \int_{\mathbb{R}_p} \prod_{j=1}^p p_\theta(Y_{ij} | Z_{ij}) \, p_\theta(\mathbf{Z}_i) \mathrm{d}\mathbf{Z}_i$$`

### Expectation-Maximization

With `\(\mathcal{H}(p) = -\mathbb{E}_p(\log(p))\)` the entropy of `\(p\)`,

`$$\log p_\theta(\mathbf{Y}) = \mathbb{E}_{p_\theta(\mathbf{Z}\,|\,\mathbf{Y})} [\log p_\theta(\mathbf{Y}, \mathbf{Z})] + \mathcal{H}[p_\theta(\mathbf{Z}\,|\,\mathbf{Y})]$$` 

EM requires to evaluate (some moments of) `\(p_\theta(\mathbf{Z} \,|\,  \mathbf{Y})\)`, but there is no close form!

### Variational approximation [WJ08]

Use a proxy `\(q_\psi\)` of `\(p_\theta(\mathbf{Z}\,|\,\mathbf{Y})\)` minimizing a divergence in a class `\(\mathcal{Q}\)` .small[(e.g, Küllback-Leibler divergence)]

`$$q_\psi(\mathbf{Z})^\star  \arg\min_{q\in\mathcal{Q}} D\left(q(\mathbf{Z}), p(\mathbf{Z} | \mathbf{Y})\right), \, \text{e.g.}, D(.,.) = KL(., .) = \mathbb{E}_{q_\psi}\left[\log \frac{q(z)}{p(z)}\right].$$`

---
# Inference: specific ingredients

Consider `\(\mathcal{Q}\)` the class of diagonal multivariate Gaussian distributions:

`$$\Big\{q: \, q(\mathbf{Z}) = \prod_i q_i(\mathbf{Z}_i), \, q_i(\mathbf{Z}_i) = \mathcal{N}\left(\mathbf{Z}_i; \mathbf{m}_i, \mathrm{diag}(\mathbf{s}_i \circ \mathbf{s}_i)\right), \boldsymbol\psi_i = (\mathbf{m}_i, \mathbf{s}_i) \in\mathbb{R}_p\times\mathbb{R}_p \Big\}$$`

and maximize the ELBO (Evidence Lower BOund)

`$$\begin{aligned}J(\theta, \psi) &amp; = \log p_\theta(\mathbf{Y}) - KL[q_\psi (\mathbf{Z}) ||  p_\theta(\mathbf{Z} | \mathbf{Y})] \\ &amp; = \mathbb{E}_{\psi} [\log p_\theta(\mathbf{Y}, \mathbf{Z})] + \mathcal{H}[q_\psi(\mathbf{Z})] \\  &amp; 
= \frac{1}{n} \sum_{i = 1}^n J_i(\theta, \psi_i),\end{aligned}$$`

where, letting `\(\mathbf{A}_i = \mathbb{E}_{q_i}[\exp(Z_i)] = \exp\left( \mathbf{o}_i + \mathbf{m}_i + \frac{1}{2}\mathbf{s}^2_i\right)\)`, we have

`$$\begin{aligned}
J_i(\theta, \psi_i) = &amp;\mathbf{Y}_i^\intercal(\mathbf{o}_i + \mathbf{m}_i) - \left(\mathbf{A}_i - \frac{1}{2}\log(\mathbf{s}^2_i)\right) ^\intercal \mathbf{1}_p + \frac{1}{2} |\log|{\boldsymbol\Omega}|  \\
&amp; - \frac{1}{2}(\mathbf{m}_i - \boldsymbol{\Theta}\mathbf{x}_i)^\intercal \boldsymbol{\Omega} (\mathbf{m}_i - \boldsymbol{\Theta}\mathbf{x}_i) - \frac{1}{2} \mathrm{diag}(\boldsymbol\Omega)^\intercal\mathbf{s}^2_i + \mathrm{cst} 
\end{aligned}$$`

---
# Resulting Variational EM

.important[Alternate] until convergence between

  - VE step: optimize `\(\boldsymbol{\psi}\)` (can be written individually)
`$$\psi_i^{(h)} = \arg \max J_{i}(\theta^{(h)}, \psi_i) \left( = \arg\min_{q_i} KL[q_i(\mathbf{Z}_i) \,||\, p_{\theta^h}(\mathbf{Z}_i\,|\,\mathbf{Y}_i)] \right)$$`
  - M step: optimize `\(\theta\)`
`$$\theta^{(h)} = \arg\max \frac{1}{n}\sum_{i=1}^{n}J_{Y_i}(\theta, \psi_i^{(h)})$$`

We end up with a `\(M\)`-estimator:

$$
`\begin{equation}
\hat{\theta}^{\text{ve}} = \arg\max_{\theta} \left( \frac{1}{n}\sum_{i=1}^{n} \sup_{\psi_i} J_i(\theta, \psi_i) \right)  = \arg\max_{\theta} \underbrace{\left(\frac{1}{n}\sum_{i=1}^{n} \bar{J}_i(\theta) \right)}_{\bar{J}_n(\theta)} 
\end{equation}`
$$
where `\(\bar{J}_i(\theta) = \sup_{\psi_i} J_i(\theta,\psi_i)\)` is the *profiled* objective function.

---
# Optimization of simple PLN models

### Property of the objective function
  
The ELBO `\(J(\theta, \psi)\)` is bi-concave, i.e.
  - concave wrt `\(\psi = (\mathbf{M}, \mathbf{S})\)` for given `\(\theta\)` 
  - convace wrt `\(\theta = (\boldsymbol\Sigma, \mathbf{B})\)` for given `\(\psi\)` 

but .important[not jointly concave] in general.

### M-step: analytical

`$$\hat{{\mathbf{B}}} = \left(\mathbf{X}^\top \mathbf{X}\right)^{-1} \mathbf{X} \mathbf{M}, \quad 
   \hat{{\boldsymbol\Sigma}} = \frac{1}{n} \left(\mathbf{M}-\mathbf{X}\hat{{\mathbf{B}}}\right)^\top \left(\mathbf{M}-\mathbf{X}\hat{\mathbf{B}}\right) + \frac{1}{n} \mathrm{diag}(\mathbf{1}^\intercal\mathbf{S}^2)$$`

### VE-step: gradient ascent

`$$\frac{\partial J(\psi)}{\partial \mathbf{M}} =  \left(\mathbf{Y} - \mathbf{A} - (\mathbf{M} - \mathbf{X}{\mathbf{B}}) \mathbf{\Omega}\right), \qquad \frac{\partial J(\psi)}{\partial \mathbf{S}} = \frac{1}{\mathbf{S}} - \mathbf{S} \circ \mathbf{A} - \mathbf{S} \mathrm{D}_{\boldsymbol\Omega} .$$`
`\(\rightsquigarrow\)` Same routine for other PLN variants.

---
# Implementations

#### Medium scale problems

  - **implementation**: `NLopt` nonlinear-optimization library [Joh11] &lt;br/&gt;

&lt;!-- PROPERTIES OF THE VARIATIONAL ESTIMATORS--&gt;


---
# Estimator Bias and consistency

### M-estimation framework [Van00]

Let `\(\hat{\psi}_i = \hat{\psi}_i(\theta, \mathbf{Y}_i) = \arg \max_{\psi} J_i(\theta, \psi)\)` and consider the stochastic map `\(\bar{J}_n\)` defined by

`$$\bar{J}_n \; : \quad \theta \mapsto \frac{1}{n}\sum_{i=1}^{n} J_i(\theta, \hat{\psi}_i) \stackrel{\Delta}{=} \frac{1}{n}\sum_{i=1}^{n} 
\bar{J}_i(\theta)$$`

M-estimation suggests that `\(\hat{\theta}^{\text{ve}} = \arg\max_{\theta} \bar{J}_{n}(\theta)\)` should converge to `\(\bar{\theta} = \arg\max_{\theta} \bar{J}(\theta)\)` where `\(\bar{J}(\theta) = \mathbb{E}_{\theta^\star}[\bar{J}_Y(\theta)] =  \mathbb{E}_{\theta^\star}[J_Y(\theta, \hat{\psi}(\theta, Y))]\)`. 

--

### Theorem [WM15]

In this line, Westling and McCormick [WM15] show that under regularity conditions ensuring that `\(\bar{J}_n\)` is smooth enough (e.g. when `\(\theta\)` and `\(\psi_i\)` are restricted to compact sets), 
$$
\hat{\theta}^{\text{ve}} \xrightarrow[n \to +\infty]{a.e.} \bar{\theta}
$$

.important[Open question:] `\(\bar{\theta} = \theta^\star\)` ? No formal results as `\(\bar{J}\)` is untractable but numerical evidence suggests so.

# Estimator Variance

## Motivation: Wald test

Test `\(\mathcal{H}_0: R \theta = r_0\)` with the statistic
$$ (R \hat{\theta} - r_0)^\top \left[n R\hat{\mathbb{V}}(\hat{\theta}) R^\top \right]^{-1} (R \hat{\theta} - r_0) \sim \chi_k^2 \quad \text{where} \quad k = \text{rank}(R).$$

If `\(\hat{\theta}\)` is the MLE, then the Fisher Information matrix

`$$I(\theta) = -  \mathbb{E}_\theta \left[ \frac{\partial^2 \log \ell(\theta; x)}{\partial  \theta^2} \right]$$`

can be used to build an approximation of `\(n\mathbb{V}(\hat{\theta})^{-1}\)`.

## Application

Derive confidence intervals for the inverse covariance `\(\mathbf{\Omega}\)` and the regression parameters `\(\mathbf{B}\)`.

---

# Variance: naïve approach

Do as if `\(\hat{\theta}^{\text{ve}}\)` was a MLE and `\(\bar{J}_n\)` the log-likelihood.

### Variational Fisher Information

The Fisher information matrix is given by (from the Hessian of `\(J\)`) by

`$$I_n(\hat{\theta}^{\text{ve}}) = \begin{pmatrix}
  \frac{1}{n}(\mathbf{I}_p \otimes 
\mathbf{X}^\top)\mathrm{diag}(\mathrm{vec}(\mathbf{A}))(\mathbf{I}_p \otimes \mathbf{X}) &amp; \mathbf{0} \\
  \mathbf{0} &amp; \frac12\mathbf{\Omega}^{-1} \otimes 
\mathbf{\Omega}^{-1} 
  \end{pmatrix}$$`

and can be inverted blockwise to estimate `\(\mathbb{V}(\hat{\theta})\)`.

--

### Wald test and coverage

`\(\hat{\mathbb{V}}(B_{kj}) = [n (\mathbf{X}^\top \mathrm{diag}(\mathrm{vec}(\hat{A}_{.j})) \mathbf{X})^{-1}]_{kk}, \qquad \hat{\mathbb{V}}(\Omega_{kl}) = 2\hat{\Omega}_{kk}\hat{\Omega}_{ll}\)`

The confidence intervals at level `\(\alpha\)` are given by 

`\(B_{kj} =  \hat{B}_{kj} \pm \frac{q_{1 - \alpha/2}}{\sqrt{n}} \sqrt{\hat{\mathbb{V}}(B_{kj})}, \qquad \Omega_{kl} =  \hat{\Omega}_{kl} \pm \frac{q_{1 - \alpha/2}}{\sqrt{n}} \sqrt{\hat{\mathbb{V}}(\Omega_{kl})}\)`.

# Variance : sandwich estimator (I)

Pursuing on the M-estimation theory of Van der Vaart [Van00], Westling and McCormick [WM15] prove 
asymptotic normality of variational estimators and discuss the .important[sandwich] estimator of the variance.

### Theorem [WM15]

Under additional regularity conditions (still satisfied for example when `\(\theta\)` and `\(\psi_i\)` are restricted to compact sets), we have 
$$
\sqrt{n}(\hat{\theta}^{\text{ve}} - \bar{\theta})  \xrightarrow[]{d} \mathcal{N}(0, V(\bar{\theta}))
$$
where `\(V(\theta) = C(\theta)^{-1} D(\theta) C(\theta)^{-1}\)` for 

$$
`\begin{aligned}
 C(\theta) = \mathbb{E}[\nabla_{\theta\theta} \bar{J}(\theta) ] \quad \mathrm{and} \quad 
 D(\theta) = \mathbb{E}\left[(\nabla_{\theta} \bar{J}(\theta)) (\nabla_{\theta} \bar{J}(\theta)^\intercal \right]
\end{aligned}`
$$

---
# Variance : sandwich estimator (II)

We need estimations of `\(\nabla_{\theta\theta} \bar{J}(\theta)\)` and `\(C\)` and `\(D\)` 

### Practical computations .small[chain rule]

$$
`\begin{aligned}
\nabla_{\theta\theta} \bar{J}(\theta) = \left[\nabla_{\theta\theta} J - \nabla_{\theta \psi} J (\nabla_{\psi\psi} J)^{-1} \nabla_{\psi\theta} J\right] (\theta, \hat{\psi}) \text{ and } \nabla_{\theta} \bar{J}(\theta) = \nabla_{\theta} J(\theta, \hat{\psi})
\end{aligned}`
$$

$$
`\begin{aligned}
 \hat{C}_n(\theta) &amp; = \frac{1}{n} \sum_{i=1}^n \left[ \nabla_{\theta\theta} J_i - \nabla_{\theta\psi_i} J_i (\nabla_{\psi_i\psi_i} J_i)^{-1} \nabla_{\theta\psi_i} J_i^\intercal \right](\theta, \hat{\psi}_i) \\
 \hat{D}_n(\theta) &amp; = \frac{1}{n} \sum_{i=1}^n \left[ \nabla_{\theta} J_i \nabla_{\theta} J_i^\intercal \right](\theta, \hat{\psi}_i)
\end{aligned}`
$$
&lt;br/&gt;

### Caveat

- For `\(\theta = (\mathbf{B}, \boldsymbol\Omega)\)`, `\(\hat{C}_n\)` requires the inversion of `\(n\)` matrices with `\((p^2+pd)\)` rows/columns...
- Let us first consider the estimation of `\(\theta = \mathbf{B}\)` only, with .important[known variance] `\(\boldsymbol\Omega^{-1}\)`

---
# Reasonably fancy formula
 
Additional matrix algebra efforts and computational tricks give

$$
`\begin{aligned}
\hat{D}_n(\theta) = \frac{1}{n} \sum_{i=1}^n \left[ (\mathbf{Y}_i - \mathbf{A}_i)(\mathbf{Y}_i - \mathbf{A}_i)^\intercal \right] \otimes \mathbf{x}_i \mathbf{x}_i^\intercal \in \mathbb{R}^{dp \times dp}
\end{aligned}`
$$
and 

$$
`\begin{aligned}
\hat{C}_n(\theta) = - \frac{1}{n} \sum_{i=1}^n \left( \boldsymbol\Sigma + \mathrm{diag}(\mathbf{A}_i)^{-1}  + \frac12\mathrm{diag}(\mathbf{s}_i^4) \right) \otimes \mathbf{x}_i \mathbf{x}_i^\intercal \in \mathbb{R}^{dp \times dp}
\end{aligned}`
$$
`\(\rightsquigarrow\)` Practically not very useful since `\(\Sigma\)` is unknown

#### Ongoing work 

Derive the formula with unknown `\(\boldsymbol\Sigma\)`
- Plugin-in  `\(\hat{\Sigma}\)` in the formula of `\(\hat{C}_n\)` leads .important[very] poor results
- Need to account for cross-terms in `\(\nabla_{\theta \psi_i} J_i(\theta, \hat{\psi}_i)\)` between `\(\Omega\)` and `\(\psi_i\)`, and inverse with large matrices: limited practical interest
- Idea: use Jackknife resampling to estimate the variance

# Direct optimization of the likelihood &lt;br/&gt; .small[Gradient estimation with importance sampling] 


---

# Consider the PLN-PCA variant

Useful for high-dimensional, large problems.

&lt;br/&gt;


`$$\begin{aligned}
\mathbf{Z}_i &amp;=  \mathbf{B}^\intercal x_i+ \mathbf{C} W_i, \qquad W_{i} \sim \mathcal{N}\left(0, I_{q}\right) \\[1.25ex]
\mathbf{Y}_i  \mid \mathbf{Z}_i &amp; \sim \mathcal{P}\left(\exp \left( \mathbf{Z}_i\right)\right) \\
\end{aligned}$$`

where `\(q\leq p\)` is the dimension of the latent space. The model parameters encompass

&lt;br/&gt;

  - The matrix of regression parameters `\(\mathbf{B} = (\beta _{kj})_{1 \leq k \leq d, 1 \leq j \leq p}\)`,
  - The matrix `\(\mathbf{C} \in \mathbb R^{p\times q}\)` sending the latent variable `\(W_i\)` from `\(\mathbb{R}^q\)` to `\(\mathbb{R}^p\)`.

If `\(p = q\)`, `\(\theta = (\mathbf{B}, \Sigma = \mathbf{C} \mathbf{C}^\intercal)\)`, .important[standard PLN]

If `\(q &lt; p\)`, `\(\theta = (\beta, C)\)`, .important[PLN-PCA]

&lt;br/&gt;

We regularize by .important[controling the number of parameters] (or size of the subspace) with `\(q\)`

---
# Performance of V-EM for PLN-PCA

&lt;div class="figure" style="text-align: center"&gt;
&lt;img src="figs/Comparison_fastPLN_vs_fastPLNPCA_n=1000.png" alt="Running times for `\(n=1000, q=10, d=1\)`." width="60%" /&gt;
&lt;p class="caption"&gt;Running times for `\(n=1000, q=10, d=1\)`.&lt;/p&gt;
&lt;/div&gt;

- **PLN**: convergence in a small number of iterations but with `\(\mathcal{O}(n p + p^2)\)` parameters to optimize + inversion of `\(\hat{\Sigma} (p\times p)\)`
- **PLN-PCA**: convergence for a large number of iterations, with `\(\mathcal{O}(n p + p q)\)` parameters to optimize + inversion of `\(\hat{\Sigma} (q\times q)\)`

---
# Direct optimization

We already have an efficient V-EM, but without guarantees "out-of-the box".

&lt;br/&gt;

### .content-box-red[.small[Direct optimization by approximating the gradient of the objective]]

.content-box-yellow[


`$$\begin{aligned}
\nabla_{\theta} \sum _{i =1}^n \log p_{\theta}(Y_i) &amp; = \sum _{i =1}^n \nabla_{\theta}  \log \left(  \int_{R^q} p_{\theta} (Y_i|W_i) p(W_i)\mathrm{d} W_i \right) \\ &amp; = \sum _{i =1} ^n \nabla_{\theta} \log \mathbb{E}_W (p_\theta(Y_i|W_i)) \\
\end{aligned}$$`
]

&lt;br/&gt;

### Algorithm principle

- Ingredient 1: fancy SG ascent with variance reduction (e.g. Adagrad + SAGA)
- Ingredient 2: Monte-Carlo/Importance sampling to estimate the gradient


---
# Monte-Carlo estimation of the gradient

### Gradient derivation .small[(First Louis Formula)]

`$$\begin{aligned}
\nabla_{\theta}  \log \mathbb{E}_{W}\left[  p_{\theta} (Y_i|W)  \right]  &amp; = \frac {\nabla_{\theta}   \mathbb{E}_{W}\left[  p_{\theta} (Y_i|W)  \right]}{\mathbb{E}_{W}\left[  p_{\theta} (Y_i|W)  \right]} = \frac {\mathbb{E}_{W}\left[  \nabla_{\theta} p_{\theta} (Y_i|W)  \right]}{\mathbb{E}_{W}\left[  p_{\theta} (Y_i|W)  \right]} \\ &amp; = \frac {\mathbb{E}_{W}\left[ p_{\theta} (Y_i|W) \nabla_{\theta} \log(p_{\theta} (Y_i|W))  \right]}{\mathbb{E}_{W}\left[  p_{\theta} (Y_i|W)  \right]} = \frac{\bar N}{\bar D} \\
\end{aligned}$$`

--

### Approximation via Importance Sampling 

Our estimator of the numerator and the denominator are respectively, drawing `\(V_k \sim \phi(.)\)`,

`$$\bar N = \frac 1 {n_s} \sum_{k=1}^{n_s} \frac {p(V_k)}{\phi(V_k)} p_\theta(Y_i|V_k) \nabla_{\theta}\log p_\theta(Y_i| V_k), \bar D = \frac 1 {n_s} \sum_{k=1}^{n_s} \frac {p(V_k)}{\phi(V_k)} p_\theta(Y_i| V_k),$$`

and the ratio can be seen as a self normalizing weighted IS approach:

`$$\bar N/\bar D = \frac 1 {n_s} \sum_k^{n_s} \tilde{w}_k \nabla_{\theta}\log p_\theta(Y_i| V_k), \quad w_k = \frac {p(V_k)p_\theta(Y_i|V_k)}{\phi(V_k)}, \quad \tilde{w}_k = w_k/\sum_k w_k$$`


---
# How to choose the proposition law `\(\phi\)`
  
Choose `\(\phi\)` as close as possible as `\(p_\theta (Y|W)p(W) \varpropto p_\theta(W | Y)\)`,

Since `\(p(W)\)` is Gaussian, we choose `\(\phi\)` Gaussian with

- mean `\(m = \mathbb{E}_W\left[W |Y \right]\)`, estimated using IS with weights recycled from the previous iterations.

- covariance `\(\Sigma\)`, estimated from the 2nd derivative taken in `\(m\)` (explicit)

`$$\Omega^{-1} = - \nabla_{WW} \log p_{\theta}(Y_i| W) p(W) \bigg|_{W = m}$$`
### Expected theoretical guarantees

- Gaussian proposition law does not give bounded weights and finite variance in theory
- Student proposition law does, leading to theoretical guarantees on the estimator 
- In practice, Gaussian or Student proposition law gives the same effective sample size. 

`\(\rightsquigarrow\)` CI intervals seems to work OK

# Zero-inflated PLN

&lt;!-- ZI-PLN MODEL --&gt;


---

# A zero-inflated PLN

### Motivations 

- account for a large amount of zero, i.e. with single-cell data,
- try to separate "true" zeros from "technical"/dropouts

### The Model

Use two latent vectors `\(\mathbf{W}_i\)` and `\(\mathbf{Z}_i\)` to model excess of zeroes and dependence structure 
`$$\begin{aligned}
   \mathbf{Z}_i &amp; \sim \mathcal{N}({\mathbf{o}_i + \mathbf{x}_i^\top\mathbf{B}},\boldsymbol\Sigma) \\
    W_{ij} &amp; \sim \mathcal{B}(\text{logit}^{-1}(\mathbf{x}_i^\top{\mathbf{B}}_j^0)) \\
    Y_{ij} \, | \, W_{ij}, Z_{ij} &amp; \sim W_{ij}\delta_0 + (1-W_{ij}) \mathcal{P}\left(\exp\{Z_{ij}\}\right), \\
\end{aligned}$$`
  
The unkwown parameters are 
- `\(\mathbf{B}\)`, the regression parameters (from the PLN component)
- `\(\mathbf{B}^0\)`, the regression parameters (from the Bernoulli component)
- `\(\boldsymbol\Sigma\)`, the variance-covariance matrix

`\(\rightsquigarrow\)` ZI-PLN is a mixture of PLN and Bernoulli distribution with shared covariates.

---

# ZI-PLN identifiability

Consider the standard ZIPLN model (*i.e.* not the ZIPLN-regression model) with 1 sample: 

`$$\begin{aligned}
  {(W_j)}_{j=1 \dots p} &amp; \sim \mathcal{B}^{\otimes} ( \mathbf{\pi} ) = \mathcal{B}(\pi_1) \otimes \dots \mathcal{B}(\pi_p) \\
  {(Z_j)}_{j=1 \dots p} &amp; \sim \mathcal{N}_p(\mathbf{\mu}, \mathbf{\Sigma} ) \\
  Y_j | W_j, Z_j &amp; \sim (1-W_j) \mathcal{P}(e^{Z_j}) + W_j \delta_0 \\
\end{aligned}$$`

### Proposition

The standard ZIPLN model defined above with parameter `\(\mathbf{\theta} = (\mathbf{\pi}, \mathbf{\mu}, \mathbf{\Sigma})\)` and parameter space `\((0,1)^{p} \times \mathbb{R}^p \times \mathbb{S}_p^{++}\)` is identifiable. 

**Proof**. We used the moments of `\(\mathbf{Y}\)` to prove identifiability and rely on the following results for Gaussian and Poisson distributions:

  - If `\(U \sim \mathcal{N}(\mu, \sigma^2)\)`, then `\(\mathbb{E}[e^U] = \exp(\mu + \sigma^2/2)\)`
  - If `\(U \sim \mathcal{P}(\lambda)\)` then `\(\mathbb{E}[U] = \lambda \quad  \mathbb{E}[U^2] = \lambda (1 + \lambda) \quad \mathbb{E}[U^2] = \lambda (1 + 3\lambda + \lambda^2)\)`

Each coordinate of `\(\mathbf{\theta}\)` can be expressed as a simple functions of the (first three) moments of `\(p_{\mathbf{\theta}}\)` and thus `\(p_{\mathbf{\theta}} = p_{\mathbf{\theta}'} \Rightarrow \mathbf{\theta} = \mathbf{\theta}'\)`. 

---

# ZI-PLN Inference

Same routine...

### Variational approximation

`\begin{equation*}
p(\mathbf{Z}_i, \mathbf{W}_i  \mathbf{Y}_i) \approx q_{\psi}(\mathbf{Z}_i, \mathbf{W}_i) \approx q_{\psi_1}(\mathbf{Z}_i) q_{\psi_2}(\mathbf{W}_i)
\end{equation*}`

with

`\begin{equation*}
q_{\psi_1}(\mathbf{Z}_i) = \mathcal{N}(\mathbf{Z}_i; \mathbf{m}_{i}, \mathrm{diag}(\mathbf{s}_{i} \circ \mathbf{s}_{i})), \qquad q_{\psi_2}(\mathbf{W}_i) = \otimes_{j=1}^p \mathcal{B}(W_{ij}, \pi_{ij})
\end{equation*}`

### Variational lower bound

Let `\(\theta = (\mathbf{B}, \mathbf{B}^0, \mathbf{\Sigma})\)` and `\(\psi= (\mathbf{M}, \mathbf{S}, \mathbf{\Pi})\)`, then

`\begin{align*}
J(\theta, \psi) &amp; =  \log p_\theta(\mathbf{Y}) - KL(p_\theta(. | \mathbf{Y}) \| q_\psi(.) ) \\
&amp; = \mathbb{E}_{q_{\psi}} \log p_\theta(\mathbf{Z}, \mathbf{W}, \mathbf{Y}) - \mathbb{E}_{q_{\psi}} \log q_\psi(\mathbf{Z}, \mathbf{W}) \\
&amp; = \mathbb{E}_{q_{\psi}} \log p_\theta (\mathbf{Y} | \mathbf{Z}, \mathbf{W}) + \mathbb{E}_{q_{\psi_1}} \log p_\theta (\mathbf{Z}) + \mathbb{E}_{q_{\psi_2}} \log p_\theta (\mathbf{W}) \\
&amp;  \qquad - \mathbb{E}_{q_{\psi_1}} \log q_{\psi_{1}} (\mathbf{Z}) - \mathbb{E}_{q_{\psi_2}} \log q_{\psi_2} (\mathbf{W}) \\
\end{align*}`

**Property**: `\(J\)` is separately concave in `\(\theta\)`, `\(\psi_1\)` and `\(\psi_2\)`.

---

# Optimizaton

### A sparse criterion

Recall that `\(\theta = (\mathbf{B}, \mathbf{B}^0, \mathbf{\Omega} = \mathbf{\Sigma}^{-1})\)`. Sparsity allows to control the number of parameters: 

`\begin{equation*}
 \arg\min_{\theta, \psi} J(\theta, \psi)  + \lambda_1 \| \mathbb{B}  \|_1 + \lambda_2 \|  \mathbb{\Omega}  \|_1 \color{#ddd}{ \left( + \lambda_1 \| \mathbb{B}^0  \|_1 \right)}
\end{equation*}`

### Alternate optimization

  - (Stochastic) Gradient-descent on `\(\mathbf{B}^0, \mathbf{M}, \mathbf{S}\)`
  - Closed-form for posterior probabilities `\(\mathbf{\Pi}\)`
  - Inverse covariance `\(\mathbf{\Omega}\)` 
    - if `\(\lambda_2=0\)`, `\(\hat{\mathbf{\Sigma}} = n^{-1} \left[ (\mathbf{M} - \mathbf{XB})^\top(\mathbf{M} - \mathbf{XB}) + \bar{\mathbf{S}}^2 \right]\)`
    - if `\(\lambda_2 &gt; 0\)`, `\(\ell_1\)` penalized MLE ( `\(\rightsquigarrow\)` Graphical-Lasso with `\(\hat{\mathbf{\Sigma}}\)` as input)
  - PLN regression coefficient `\(\mathbf{B}\)` 
    - if `\(\lambda_1=0\)`, `\(\hat{\mathbf{B}} = [\mathbf{X}^\top \mathbf{X}]^{-1} \mathbf{X}^\top \mathbf{M}\)`
    - if `\(\lambda_1 &gt; 0\)`, vectorize and solve a `\(\ell_1\)` penalized least-squared problem

**Initialize** `\(B^0\)` with logistic regression on `\(\delta_0(\mathbf{Y})\)`, `\(\mathbf{B}\)` with Poisson regression

# A quick example in genomics (1)

### scRNA data set 

The dataset `scRNA` contains the counts of the 500 most varying transcripts in the mixtures of 5 cell lines in human liver (obtained with standard 10x scRNAseq Chromium protocol).

We subsample 500 random cells and the keep the 200 most varying genes


```r
library(PLNmodels); library(ZIPLN)
data(scRNA); set.seed(1234)
scRNA        &lt;- scRNA[sample.int(nrow(scRNA), 500), ]
scRNA$counts &lt;- scRNA$counts[, 1:200]
scRNA$counts %&gt;% as_tibble() %&gt;% rmarkdown::paged_table()
```

# A quick example in genomics (2)

## Model fits

We adjust the standard PLN model and the ZI-PLN model with some sparsity on the precision matrix:


```r
system.time(myPLN &lt;- 
    PLN(counts ~ 1 + offset(log(total_counts)),
        data = scRNA, control = list(trace = 0)))
```

```
##    user  system elapsed 
## 126.280   0.098  32.049
```


```r
system.time(myZIPLN &lt;- 
    ZIPLN(counts ~ 1 + offset(log(total_counts)), rho = .1,
          data = scRNA, control = list(trace = 0)))
```

```
##    user  system elapsed 
##  86.317   0.062  13.522
```

# Conclusion

## Summary

  - PLN = generic model for multivariate count data analysis
  - Flexible modeling of the covariance structure, allows for covariates
  - Efficient V-EM algorithm
  - Variational estimator is asymptotically normal (and hopefully unbiased) with computable covariance matrix. 
  - ZI-PLN reduces (some) problems induced by high sparsity in the data

## Work in progress

  - Caracterisation of Variational Estimator
  - Direct likelihood optim (Stochastic Gradient + Important Sampling)
  - Optimisation guarantee for coupling adpative SGD + variance reduction
  - Connection/Comparison with VAE with e.g Poisson neg log-likelihood as loss
